import { Link } from "react-router-dom";

const MainHeader = () => {
  return (
    <footer>
      <nav>
        <ul>
          <li>
            <Link to="/login">PRIJAVA</Link>
          </li>
          <li>
            <Link to="/register">REGISTRACIJA</Link>
          </li>
        </ul>
      </nav>
    </footer>
  );
};

export default MainHeader;
